package com.ufgov.zc.client.common.converter.zc;import java.util.List;import java.util.Vector;import com.ufgov.zc.client.datacache.AsValDataCache;import com.ufgov.zc.common.zc.model.EmFundPayReport;public class ZcEmFundPayReportToTableModelConverter extends BaseEntryToTableModelConverter {  @SuppressWarnings("unchecked")  protected Vector<Object> getValue(List list) {    Vector<Object> values = new Vector<Object>();    if (null != list) {      for (int i = 0; i < list.size(); i++) {        values.add(toRowData((EmFundPayReport) list.get(i)));      }    }    return values;  }  private static Vector<Object> toRowData(EmFundPayReport emFundPayReport) {    Vector<Object> rowData = new Vector<Object>();    rowData.add(emFundPayReport.getFundReportId());    rowData.add(emFundPayReport.getFundReportName());    rowData.add(emFundPayReport.getUseId());    rowData.add(emFundPayReport.getUseName());    rowData.add(emFundPayReport.getUseTime());    rowData.add(emFundPayReport.getCreateTime());    rowData.add(emFundPayReport.getFileId());    rowData.add(AsValDataCache.getName("VS_ZC_FUND_TYPE", emFundPayReport.getFundType()));    rowData.add(emFundPayReport.getPaySum());    rowData.add(emFundPayReport.getDeptId());    rowData.add(AsValDataCache.getName("VS_ZC_FUND_REPORT_STATUS", emFundPayReport.getStatus()));    return rowData;  }  protected Vector<String> getColumnName() {    Vector<String> names = new Vector<String>();    names.add("经费开支报告编号");    names.add("经费开支报告名称");    names.add("经费使用人编号");    names.add("经费使用人姓名");    names.add("经费使用时间");    names.add("经费开支报告创建时间");    names.add("经费开支报告文件编号");    names.add("经费使用类型");    names.add("经费开支金额");    names.add("部门");    names.add("经费开支报告审核状态");    return names;  }}